<script>
	import { agentState } from "$lib/store";
    import { onMount } from "svelte";
	import Seperator from "./ui/Seperator.svelte";
	import { toast } from "svelte-sonner";

	let prevMonologue = null;

	function handleMonologueChange(newValue) {
		if (newValue) {
			toast.success(newValue);
		}
	}

	onMount(() => {
		prevMonologue = $agentState?.internal_monologue;
	});

	$: if ($agentState?.internal_monologue !== prevMonologue) {
		handleMonologueChange($agentState?.internal_monologue);
		prevMonologue = $agentState?.internal_monologue;
	}

	function openImageInNewTab() {
		const base64Image = "data:image/png;base64,"; 
		const w = window.open("");
		w.document.write(`
			<!DOCTYPE html>
			<html>
			<head>
				<style>
					body {
						background-color: #282828; /* Dark gray background */
						margin: 0;
						display: flex;
						justify-content: center;
						align-items: center;
						height: 100vh;
					}
					img {
						max-width: 100%;
						max-height: 100%;
					}
				</style>
			</head>
			<body>
				<img src="${base64Image}" alt="Donation Image" />
			</body>
			</html>
		`);
		w.document.close();
	}
</script>

<div class="px-2">
	<div class="border-t flex items-center justify-between p-1.5 text-[13px] border-border">
		<!-- right -->
		<div class="flex">
			<div class="relative group px-1.5 py-0.5 hover:bg-secondary rounded-md">
				<p>
					Status :
					<span class="text-foreground"> Try Hovering on me</span>
				</p>
				<div class="absolute hidden group-hover:block -left-1 text-[13px] w-[400px] bg-monologue-background bottom-8 duration-300 p-3 rounded-2xl space-y-2 outline outline-monologue-outline z-20">	
					<p class="text-foreground">
						{$agentState?.internal_monologue || " Sleeping"}
					</p>
				</div>
			</div>
			<Seperator height={24} />
			<div class="relative px-1.5 py-0.5 rounded-md">
				<p>
					Agent status:
					{#if $agentState !== null}
						{#if $agentState.agent_is_active}
							<span class="text-green-500">Working</span>
						{:else}
							<span class="text-orange-600">Idle</span>
						{/if}
					{:else}
						Idle
					{/if}
				</p>
			</div>
			<!-- Donate Button -->
			<div class="px-1.5 py-0.5 rounded-md">
				<button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-0 px-2 rounded" on:click={openImageInNewTab}>
					Donate
				</button>
			</div>
		</div>
	</div>
</div>
